INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 4, "カオリ（サマー）", 1, 24015, "2030/12/17 14:59:59", 0.0, 4, 0.0, 110501, 0.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 4, "カオリ（サマー）", 2, 24016, "2030/12/17 14:59:59", 0.0, 1, 0.0, 110501, 4.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 4, "カオリ（サマー）", 3, 24017, "2030/12/17 14:59:59", 0.0, 4, 0.0, 110501, 0.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 1, "カオリ（サマー）", 4, 24018, "2030/12/17 14:59:59", 0.0, 2, 0.0, 110501, 5.2);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 5, "カオリ（サマー）", 5, 24019, "2030/12/17 14:59:59", 0.0, 6, 0.0, 110501, 4.2);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 2, "カオリ（サマー）", 6, 24020, "2030/12/17 14:59:59", 0.0, 2, 0.0, 110501, 0.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 1, "カオリ（サマー）", 7, 24021, "2030/12/17 14:59:59", 0.0, 6, 0.0, 110501, 6.4);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 2, "カオリ（サマー）", 8, 24022, "2030/12/17 14:59:59", 0.0, 2, 0.0, 110501, 0.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 6, "カオリ（サマー）", 9, 24023, "2030/12/17 14:59:59", 0.0, 3, 0.0, 110501, 10.08);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 1, "カオリ（サマー）", 10, 24024, "2030/12/17 14:59:59", 0.0, 2, 0.0, 110501, 5.0);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES ("2019/07/31 12:00:00", 10021, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 2, "カオリ（サマー）", 11, 24025, "2030/12/17 14:59:59", 0.0, 2, 0.0, 110501, 0.0);
